import React from 'react';

const EntryTimeline = ({ entries }) => {
  return (
    <div>
      <h3>Entry Timeline</h3>
      <ul>
        {entries.map((entry, index) => (
          <li key={index}>{`${new Date(entry.metadata.date).toLocaleDateString()}: ${entry.text}`}</li>
        ))}
      </ul>
    </div>
  );
};

export default EntryTimeline;
